import React from 'react';
import './upper.css';
import Upper from './upper';
import { Query } from 'react-apollo'
import { gql } from 'apollo-boost'


const query = gql`
{
  allArtist {
    name
  }
}
`;



class Artists extends React.Component {

    render() {
      
      return (

        <div>
        <Query query={query}>
          {
            (result)=>{
              return <Upper result={result.data} />
            }
          }
          </Query>
        </div>
        

      );
    }
  }


export default Artists
